		"title": "Between The Bars",
		"description": "Between The Bars - Elliot Smith (inspired by Taylor Eigsti)\n\n(For more music and special videos go to http://www.drei-band.de/Start )\n\nWas wollt ihr von mir, ihr alten Stimmen? \nSeid nur Schilder am Wegesrand, Verkehrsanweisungen, sonst nichts! \nDoch ich bin der Fahrer . . . und sonst nichts. \n-\n-\n-\nBetween The Bars by Elliot Smith:\n\nDrink up baby, stay up all night\nWith the things you could do\nYou won't but you might\nThe potential you'll be that you'll never see\nThe promises you'll only make\nDrink up with me now\nAnd forget all about the pressure of days\nDo what I say and I'll make you okay\nAnd drive them away\nThe images stuck in your head\n\nThe people you've been before\nThat you don't want around anymore\nThat push and shove and won't bend to your will\nI'll keep them still\n\nDrink up baby, look at the stars\nI'll kiss you again between the bars\nWhere I'm seeing you there with your hands in the air\nWaiting to finally be caught\nDrink up one more time and I'll make you mine\nKeep you apart, deep in my heart\nSeparate from the rest, where I like you the best\nAnd keep the things you forgot\n\nThe people you've been before\nThat you don't want around anymore\nThat push and shove and won't bend to your will\nI'll keep them still\n\n",
