		"description": "Since you went away, I'm never lonely.\r\nSince you went away, my days are full of cheer \r\nand sunshine my dear, since you went away.\r\n\r\nSince you went away, everything's newer.\r\nAdventure everyday, the sky is even bluer too.\r\nI don't miss you, since you went away.\r\n\r\nI don't miss dinner by candlelight.\r\nI don't miss watching movies late at night.\r\nI don't miss you holding me tight.\r\nI don't miss stars at night, I don't miss anything!\r\n\r\nSince you went away, everything's changed dear.\r\nSince you went away, I've got my own self to blame.\r\nIt's not the same, Since you went away.\r\n(c) 2001 - ASCAP",
