			"description": "   M​usic & creativity runs in my family. My dad, singer & entertainer Jerry Wallace hit it big in the '50's & ''60's with songs like \"Primrose Lane\", How The Time Flies, In the Misty Moonlight & more... His career spanned decades, recording well over 20 albums. \r\n\r\n    My Stepfather, jazz pianist, composer & arranger Dennis Michaels, has also been a huge influence on my musical direction. He has worked with Fred Travalena, Florence Henderson, to name a few & most recently has toured, recorded & arranged with the legendary singer, Keely Smith.\r\n\r\n     I have played with the duo known as \"The Fabulous Bluejayz\". Also with Wallace & Phines (duo). Others I have played with, Stephen Phines, Mike McClaren, Dave Hinz, Tami Pallingston & Nalini Cogswell & Pete Dyszczakowski. I have recorded 6 CD's, most notably \"Treehugger\" which includes the hit song, \"Julia Butterfly Hill, Are You Up There Still?\" The song is featured as theme & background music in the full-length documentary, \"BUTTERFLY\", that has aired on POV/PBS & has been screened in numerous theatres worldwide.\r\n   \r\nI'm a Songwriter, guitarist. singer, harmonicas. There is something spiritual about the creative process. I feel that the songs are gifts from the creator and once finished it's as if they were always there.\r\n\r\nI switch between styles, folk, jazzy lounge & blues.  My instruments: Yamaha FG345, Fender Strat & Harmonicas.\r\n\r\nI record all of my material on an old Roland 880EX, which is powered by the sun since I live completely off-the-grid.  Hope enjoy my music! :)",
