			"first_name": "Mark",
			"last_name": "Dorricott",
			"full_name": "Mark Dorricott",
			"city": "Shrewsbury",
			"description": "Hi, I'm a keys player and I like making up grooves to existing jazz and latin standards. Over the last few years I've been mainly working on original numbers.\n\nIt's just me in the music you hear, I play all the parts off a keyboard recording in midi and layer up into the finished version.\n\nI started playing the piano as a kid , then took up the trombone and played for fun in various local amateur bands and orchestras. Then at 18 went to college and didn't do anything  musically  for many years. Started playing the saxophone and tuba more recently, and in the last four years or so got back into the keyboard which is now my main instrument.\n\nI like making up jazzy  late night music & music you can listen to when travelling. Sounds like a strange thing but I find the most enjoyable part of a holiday is the travelling part, whether that's on a plane , train or even a car on a quiet road with some nice views. Looking through a window with a changing view, in a bubble of suspended time between two worlds, that's what travelling feels like to me, and I like to write music that sounds that way - http://soundcloud.com/markd54321/361-stolen-moments-320kbps . Can't really explain it any better than that for now. Cheers Mark",
